use StudentManagement
go
--tao bang student
create table Student(
	Id int not null primary key,
	FullName varchar(255) not null,
	Gender varchar(50) not null,
	DateOfBirth date not null,
	Email varchar(255) not null,
	PhoneNumber varchar(50) not null,
	Score float not null,
	ClassId int not null foreign key references Class(ClassId)
);
 --them du lieu vao bang

--them du lieu vao bang student
select top 1001* from Student

--sua thong tin sinh vien
update student
set FullName='Le Thi Thu Huyen', Gender='Female', DateOfBirth='2002-07-27', Email='huyen@mail.com', Score=9, ClassId=22
where Id=5;
select top 6* from Student

--xoa thong tin sinh vien
delete from student where Id=10;
select top 20 * from Student;

--tim kiem thong tin sinh vien theo id
select * from Student 
where Id=100;

--lay danh sach sinh vien cung lop
select *from Student
where ClassId=5 ;

--lay ra tong so sinh vien trong lop co classid=5
select count(Id)
from Student
where ClassId=5;

--lay ra 10 sinh vien diem cao nhat trong lop co id=5
select top 10* from Student 
where ClassId=5 
order by Score desc;

--thong ke so hoc sinh nam trong mot lop bat ki
select count(Id)
from Student
where ClassId=5 and Gender='Male';

--diem trung binh cua lop co id bang 5
select avg(Score)
from Student
where ClassId=5;



